package cn.guankejian.test

import androidx.paging.ExperimentalPagingApi
import androidx.paging.LoadType
import androidx.paging.PagingState
import androidx.paging.RemoteMediator
import androidx.room.withTransaction
import cn.guankejian.test.bean.AddMZTag
import cn.guankejian.test.bean.MZTag
import cn.guankejian.test.db.MeiNvDatabase

@ExperimentalPagingApi
class TagMediator(
    val db: MeiNvDatabase
) : RemoteMediator<Int, MZTag>() {
    private val dao = db.mzTagDao()
    override suspend fun load(
        loadType: LoadType,
        state: PagingState<Int, MZTag>
    ): MediatorResult {

        try {
            when (loadType) {
                LoadType.PREPEND -> {
                    return MediatorResult.Success(endOfPaginationReached = true)
                }
                LoadType.APPEND -> {
                    return MediatorResult.Success(endOfPaginationReached = true)
                }
            }

            val list =getMZTag()


            db.withTransaction {
                if (loadType == LoadType.REFRESH) {
                    dao.clear()
                }
                dao.insert(list)
            }

            return MediatorResult.Success(true)
        } catch (e: Exception) {
            return MediatorResult.Error(Throwable("error"))
        }
    }

    private  fun getMZTag(): List<AddMZTag> {
        return listOf(
            AddMZTag("data:image/jpeg;base64,","a","a"),
            AddMZTag("data:image/png;base64,","b","b"),
            AddMZTag("data:image/png;base64,","c","c"),
            AddMZTag("data:image/png;base64,","d","d"),
            AddMZTag("data:image/png;base64,","e","e"),
            AddMZTag("data:image/jpeg;base64,","f","f"),
            AddMZTag("data:image/jpeg;base64,","g","g"),
            AddMZTag("data:image/jpeg;base64,","h","h"),
            AddMZTag("data:image/png;base64,","i","i"),
            AddMZTag("data:image/jpeg;base64,","j","j"),
            AddMZTag("data:image/jpeg;base64,","k","k"),
            AddMZTag("data:image/jpeg;base64,","l","l"),
            AddMZTag("data:image/png;base64,","m","m"),
            AddMZTag("data:image/png;base64,","n","n"),
        )
    }
}